import linux from "./img/linux.png";
const Sdata = [
  {
    imgsrc: linux,
    title: "webtitle",
  },
  {
    imgsrc: linux,
    title: "apptitle",
  },
  {
    imgsrc: linux,
    title: "reacttitle",
  },
  {
    imgsrc: linux,
    title: "software",
  },
  {
    imgsrc: linux,
    title: "javatitle",
  },
  {
    imgsrc: linux,
    title: "pythontitle",
  },
];
export default Sdata;
